        yt:format=''6''/><media:credit role=''uploader'' scheme=''urn:youtube'' yt:display=''ESPN''
        yt:type=''partner''>espn</media:credit><media:description type=''plain''>San
        Francisco 49ers Patrick Willis, perhaps the best linebacker in the NFL, just
        bought a house. Big deal? It is for Willis, who grew up in an abusive household
        bereft of what many of us take for granted -- no running water, no electricity
        and, worst of all, no compassion. Forced at an early age to be a leader and
        fend for himself and his siblings in the face of beatings and neglect by an
        abusive father, Willis eventually settled in with a foster family that helped
        turn his life around and bring him to where he is now. Finally, his mission
        to find a place to call home just might have ended. E:60''s Jeff Chadiha returns
        with Willis to the rural Tennessee hometown where the four-time Pro Bowler''s
        harrowing journey began</media:description><media:keywords/><media:license
