        yt:format=''6''/><media:credit role=''uploader'' scheme=''urn:youtube'' yt:display=''ESPN''
        yt:type=''partner''>espn</media:credit><media:description type=''plain''>Arian
        Foster is a fantasy football superstar, self-made after his breakout 231-yard,
        3-touchdown performance against the Colts in Week 1 last season. Yet, he has
        been doubted his entire life. His attitude? Take all criticism personally.
        And don''t listen to adults. Foster''s high school coaches didn''t believe
        he was running back material. When he played college football at Tennessee,
        his durability was questioned and he was criticized for fumbling. At the 2009
        NFL draft, he went undrafted. Later that year, the Houston Texans took a chance
        on Foster and placed him on the practice squad. He fought to win the starting
        job in 2010. Since then, he has been one of the league''s top rushers. Arian
        Foster narrates his journey to becoming one of the best running backs in the
        NFL</media:description><media:keywords/><media:license type=''text/html''
